package net.zdsoft.office.dataAnalysis.service.impl;import java.util.*;import net.zdsoft.office.dataAnalysis.entity.OfficeDataReportStreet;import net.zdsoft.office.dataAnalysis.service.OfficeDataReportStreetService;import net.zdsoft.office.dataAnalysis.dao.OfficeDataReportStreetDao;import net.zdsoft.keel.util.Pagination;/** * office_data_report_street  * @author  *  */public class OfficeDataReportStreetServiceImpl implements OfficeDataReportStreetService{	private OfficeDataReportStreetDao officeDataReportStreetDao;		/**	 * 新增office_data_report_street	 * @param officeDataReportStreet	 * @return	 */	@Override	public OfficeDataReportStreet save(OfficeDataReportStreet officeDataReportStreet){		officeDataReportStreet.setCreationTime(new Date());		return officeDataReportStreetDao.save(officeDataReportStreet);	}		/**	 * 根据ids数组删除office_data_report_street数据	 * @param ids	 * @return	 */	@Override	public Integer delete(String[] ids){		return officeDataReportStreetDao.delete(ids);	}		/**	 * 更新office_data_report_street	 * @param officeDataReportStreet	 * @return	 */	@Override	public Integer update(OfficeDataReportStreet officeDataReportStreet){		officeDataReportStreet.setModifyTime(new Date());		return officeDataReportStreetDao.update(officeDataReportStreet);	}		/**	 * 根据id获取office_data_report_street	 * @param id	 * @return	 */	@Override	public OfficeDataReportStreet getOfficeDataReportStreetById(String id){		return officeDataReportStreetDao.getOfficeDataReportStreetById(id);	}		/**	 * 根据ids数组查询office_data_report_streetmap	 * @param ids	 * @return	 */	@Override	public Map<String, OfficeDataReportStreet> getOfficeDataReportStreetMapByIds(String[] ids){		return officeDataReportStreetDao.getOfficeDataReportStreetMapByIds(ids);	}		/**	 * 获取office_data_report_street列表	 * @return	 */	@Override	public List<OfficeDataReportStreet> getOfficeDataReportStreetList(){		return officeDataReportStreetDao.getOfficeDataReportStreetList();	}		/**	 * 分页获取office_data_report_street列表	 * @param page	 * @return	 */	@Override	public List<OfficeDataReportStreet> getOfficeDataReportStreetPage(Pagination page){		return officeDataReportStreetDao.getOfficeDataReportStreetPage(page);	}	@Override	public List<OfficeDataReportStreet> getOfficeDataReportStreetByUnitIdPage(String unitId, Pagination page) {		return officeDataReportStreetDao.getOfficeDataReportStreetByUnitIdPage(unitId,page);	}	@Override	public Map<String, OfficeDataReportStreet> getOfficeDataStreetMapByUnitid(String unitId) {		return officeDataReportStreetDao.getOfficeDataStreetMapByUnitid(unitId);	}	@Override	public List<OfficeDataReportStreet> getOfficeDataReportStreetListByIds(String[] ids) {		return officeDataReportStreetDao.getOfficeDataReportStreetListByIds(ids);	}	@Override	public List<OfficeDataReportStreet> getOfficeDataReportStreetByUnitIdStreetName(String unitId, String streetName) {		return officeDataReportStreetDao.getOfficeDataReportStreetByUnitIdStreetName(unitId,streetName);	}	public void setOfficeDataReportStreetDao(OfficeDataReportStreetDao officeDataReportStreetDao){		this.officeDataReportStreetDao = officeDataReportStreetDao;	}}